import numpy as np
import cv2
from shapely.geometry import Point, Polygon




def bbox2Cords4(bbox):
	Cords4 = []
	Cords4.append(tuple([bbox[0], bbox[1]]))
	Cords4.append(tuple([bbox[2], bbox[1]]))
	Cords4.append(tuple([bbox[2], bbox[3]]))
	Cords4.append(tuple([bbox[0], bbox[3]]))
	return Cords4

def add_padding(bbox, padding=50):
	bbox[0] = max(0, bbox[0] - padding)
	bbox[1] = max(0, bbox[1] - padding)
	bbox[2] = min(2600, bbox[2] + padding)
	bbox[3] = min(2600, bbox[3] + padding)
	return bbox

def if_intersect(coords_big, bbox):
	'''
	input:  
		coords_big: QiGuan_return['fei0_contour'] or QiGuan_return['fei1_contour']
		bbox: [xmin, ymin, xmax, ymax]
	output:
		True or False: if bbox intesect with coords_big
	'''
	coords2_small = bbox2Cords4(add_padding(bbox))
	p1 = Polygon(coords_big)
	p2 = Polygon(coords2_small)
	if not p1.is_valid:
		p1 = p1.buffer(0)
	if not p2.is_valid:
		p2 = p2.buffer(0)
	inter_sec_area = p1.intersection(p2).area
	try:
		overlap1 = inter_sec_area/p1.area
	except:
		return 'True'
	try:
		overlap2 = inter_sec_area/p2.area
	except:
		return 'True'

	overlap_max = max(overlap1, overlap2)
	overlap_min = min(overlap1, overlap2) 		

	if overlap_min < 0.01 or overlap_max > 0.99:
		return 'False'
	return 'True'

